import './App.css';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';

const App = () => {
  return (
      <Router> 
        <Navbar />
        <Routes>
          <Route exact path="/" element={<Home/>}/>
        </Routes>
      </Router>
  );
}

export default App;
